package com.five.entity;

import java.io.Serializable;
import java.util.Date;

/**
 * 请假字典表
 * 
 * @author lizhichao
 *
 */
public class LeaveDictionary implements Serializable {

	/**
	 * 
	 */
	private static final long serialVersionUID = 6800880136844801369L;
	private Integer id;// 主键id
	private String leaveCause;// 请假原因
	private Date createTime;// 创建时间
	private Date updateTime;// 修改时间
	private Integer deleteFlag;// 删除标识

	public LeaveDictionary() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Integer getId() {
		return id;
	}

	public String getLeaveCause() {
		return leaveCause;
	}

	public Date getCreateTime() {
		return createTime;
	}

	public Date getUpdateTime() {
		return updateTime;
	}

	public Integer getDeleteFlag() {
		return deleteFlag;
	}

	public void setId(Integer id) {
		this.id = id;
	}

	public void setLeaveCause(String leaveCause) {
		this.leaveCause = leaveCause;
	}

	public void setCreateTime(Date createTime) {
		this.createTime = createTime;
	}

	public void setUpdateTime(Date updateTime) {
		this.updateTime = updateTime;
	}

	public void setDeleteFlag(Integer deleteFlag) {
		this.deleteFlag = deleteFlag;
	}

	@Override
	public String toString() {
		return "LeaveDictionary [id=" + id + ", leaveCause=" + leaveCause + ", createTime=" + createTime
				+ ", updateTime=" + updateTime + ", deleteFlag=" + deleteFlag + "]";
	}

}
